import React from 'react'
import Button from '@material-ui/core/Button'
import {FaRegFilePdf} from "react-icons/fa"
import './NavBar2.css'
import { createMuiTheme,  MuiThemeProvider , WithStyles, makeStyles} from '@material-ui/core/styles';


const theme = createMuiTheme({
    palette: {
      primary: lightBlue,
    },
    overrides: {
      MuiButton: {
        raisedPrimary: {
          color: 'red',
        },
      },
    }
  });
const styles = 
    {
        ul: {
            width: "fit-content",
            float: "right",
        }, 
        button:{
            border: "0.5px solid rgb(100,255,218)",
            color: "rgb(100,255,218)", 

        },
        li:{
            display: "inline-block",
            color: "honeydew",
            margin: "1rem", 
            fontFamily:"FuturaPT, Helvetica, Arial, sans-serif",
            fontWeight: "300", 
        }
    }

function NavBar2 (props) {

    const theme = createMuiTheme({
        overrides: {
            MuiButton:{
                label:{

                    // fontWeight: "300", 
                    // fontFamily:"FuturaPT, Helvetica, Arial, sans-serif", 
                }
            }

        }});

    return (
        <MuiThemeProvider theme={theme}>
            <ul className="listNavBar" style={styles.ul}>
                <li style={styles.li}>  About Me   </li>
                <li style={styles.li}> Experience </li>
                <li style={styles.li}>  Hobbies </li>
                <li style={styles.li}>  <Button > Résumé&nbsp;&nbsp; <FaRegFilePdf /> </Button> </li>
            </ul>
        </MuiThemeProvider>
    )
}


export default NavBar2;
